IF EXISTS (SELECT * FROM sys.objects WHERE object_id = OBJECT_ID(N'[dbo].[PG_CI_VENDOR]') AND type in (N'P', N'PC'))
	DROP PROCEDURE [dbo].[PG_CI_VENDOR]
GO


CREATE PROCEDURE [dbo].[PG_CI_VENDOR]
	@PP_K_SISTEMA_EXE				INT,
	@PP_K_USUARIO_ACCION			INT,
	-- ===========================
	@PP_K_VENDOR					INT,
	@PP_D_VENDOR					VARCHAR(100),
	@PP_C_VENDOR					VARCHAR(255),
	@PP_O_VENDOR					INT, 
	-- ===========================
	@PP_BUSINESS_NAME				VARCHAR(250),
	@PP_RFC_VENDOR					VARCHAR(13),
	@PP_EMAIL						VARCHAR(100),
	@PP_PHONE						VARCHAR(100),
	@PP_N_CREDIT_DAYS				INT,
	-- ===========================
	@PP_K_STATUS_VENDOR				INT,
	@PP_K_CATEGORY_VENDOR			INT
AS				
	-- ===========================

	INSERT INTO VENDOR
			(	[K_VENDOR], [D_VENDOR], 
				[C_VENDOR], [O_VENDOR],
				-- ===========================
				[BUSINESS_NAME], [RFC_VENDOR], 
				[EMAIL_1], [PHONE], 
				[N_CREDIT_DAYS],
				-- ===========================
				[K_STATUS_VENDOR],[K_CATEGORY_VENDOR],
				-- ===========================
				[K_USUARIO_ALTA], [F_ALTA], [K_USUARIO_CAMBIO], [F_CAMBIO],
				[L_BORRADO], [K_USUARIO_BAJA], [F_BAJA]  )
		VALUES	
			(	@PP_K_VENDOR, @PP_D_VENDOR, 
				@PP_C_VENDOR, @PP_O_VENDOR, 
				-- ===========================
				@PP_BUSINESS_NAME, @PP_RFC_VENDOR, 
				@PP_EMAIL, @PP_PHONE,
				@PP_N_CREDIT_DAYS,
				-- ===========================
				@PP_K_STATUS_VENDOR, @PP_K_CATEGORY_VENDOR,
				-- ===========================
				@PP_K_USUARIO_ACCION, GETDATE(), @PP_K_USUARIO_ACCION, GETDATE(),
				0, NULL, NULL  )
		
GO


